/*Table structure for table `kube_apply` */

DROP TABLE IF EXISTS `kube_apply`;

CREATE TABLE `kube_apply` (
  `id` varchar(64) NOT NULL COMMENT '编号',
  `class_id` varchar(64) DEFAULT NULL COMMENT '班级ID',
  `course_id` varchar(64) DEFAULT NULL COMMENT '课程ID',
  `user_id` varchar(64) DEFAULT NULL COMMENT '用户ID(个人预约)',
  `start_date` datetime DEFAULT NULL COMMENT '开始时间',
  `end_date` datetime DEFAULT NULL COMMENT '结束时间',
  `type` char(1) DEFAULT NULL COMMENT '类型(0:上课，1：个人)',
  `status` char(1) NOT NULL DEFAULT '0' COMMENT '状态（0正常 1删除 2停用）',
  `create_by` varchar(64) NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(64) NOT NULL COMMENT '更新者',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  `remarks` varchar(500) DEFAULT NULL COMMENT '备注信息',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='申请预约';

/*Data for the table `kube_apply` */

/*Table structure for table `kube_class` */

DROP TABLE IF EXISTS `kube_class`;

CREATE TABLE `kube_class` (
  `id` varchar(64) NOT NULL COMMENT '编号',
  `class_name` varchar(64) NOT NULL COMMENT '班名称',
  `class_term` varchar(64) DEFAULT NULL COMMENT '学期',
  `status` char(1) NOT NULL DEFAULT '0' COMMENT '状态（0正常 1删除 2停用）',
  `create_by` varchar(64) NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(64) NOT NULL COMMENT '更新者',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  `remarks` varchar(500) DEFAULT NULL COMMENT '备注信息',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='班级';

