/*Table structure for table `kube_course` */

DROP TABLE IF EXISTS `kube_course`;

CREATE TABLE `kube_course` (
  `id` varchar(64) NOT NULL COMMENT '编号',
  `code` varchar(30) NOT NULL COMMENT '课程编码',
  `course_name` varchar(64) NOT NULL COMMENT '课程名',
  `course_type` char(1) NOT NULL COMMENT '课程类型',
  `content` varchar(200) DEFAULT NULL COMMENT '课程内容',
  `status` char(1) NOT NULL DEFAULT '0' COMMENT '状态（0正常 1删除 2停用）',
  `create_by` varchar(64) NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(64) NOT NULL COMMENT '更新者',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  `remarks` varchar(500) DEFAULT NULL COMMENT '备注信息',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='课程';

