  `repository` varchar(64) DEFAULT NULL COMMENT '仓库名',
  `version` varchar(20) DEFAULT NULL COMMENT '版本',
  `course_id` varchar(64) DEFAULT NULL COMMENT '课程ID',
  `images_id` varchar(200) DEFAULT NULL COMMENT 'docker_images_id',
