/*Table structure for table `kube_vm` */

DROP TABLE IF EXISTS `kube_vm`;

CREATE TABLE `kube_vm` (
  `id` varchar(64) NOT NULL COMMENT '编号',
  `vm_name` varchar(200) DEFAULT NULL COMMENT '虚拟机名称',
  `vm_status` char(1) DEFAULT NULL COMMENT '虚拟机状态',
  `type` char(1) DEFAULT '0' COMMENT '0:生成，1:保存容器生成',
  `vm_ip` varchar(18) DEFAULT NULL COMMENT '虚拟机IP',
  `host_ip` varchar(18) DEFAULT NULL COMMENT '虚拟机服务器IP',
  `container_id` varchar(200) DEFAULT NULL COMMENT 'containerID',
  `namespace` varchar(200) DEFAULT NULL COMMENT '命名空间',
  `deployment_name` varchar(100) DEFAULT NULL COMMENT 'deployment名',
  `images_id` varchar(64) DEFAULT NULL COMMENT '镜像表ID',
  `user_id` varchar(64) DEFAULT NULL COMMENT '用户ID',
  `apply_id` varchar(64) DEFAULT NULL COMMENT '申请ID',
  `vm_start_date` datetime DEFAULT NULL COMMENT '虚拟机启动时间',
  `status` char(1) NOT NULL DEFAULT '0' COMMENT '状态（0正常 1删除 2停用）',
  `create_by` varchar(64) NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(64) NOT NULL COMMENT '更新者',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  `remarks` varchar(500) DEFAULT NULL COMMENT '备注信息',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='虚拟机';

